import React, { useState, useRef } from "react";
import Header from "./components/Header";

function App() {
  const handleForm = (e) => {
    e.preventDefault();
  };

  return (
    <div className="App">
      <Header />

      <form action="" onSubmit={handleForm}>
        <input type="text" />
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default App;
